import React from "react";

const TokyoDogRunPage: React.FC = () => {
  return (
    <div>
      <h1>東京のドッグラン一覧</h1>
      <p>東京にあるドッグランの情報をご紹介してます</p>
    </div>
  );
};

export default TokyoDogRunPage;
